import React, { useState } from "react";

const Header = () => {
  const [navbarOpen, setNavbarOpen] = useState(false);

  const toggleNavbar = () => {
    setNavbarOpen(!navbarOpen);
  };

  return (
    <header>
      <div className="nav-6 p-4 flex justify-between border">
        <nav className="space-x-4 w-full flex items-center">
          <div className="container flex justify-between mx-auto">
            <h1 className="text-xl font-bold">Carrot</h1>
            <button
              className="lg:hidden inline-flex items-center justify-center text-black border h-10 w-10 rounded-md outline-none focus:outline-none"
              onClick={toggleNavbar}
            >
              <svg
                xmlns="http://www.w3.org/2000/svg"
                fill="none"
                viewBox="0 0 24 24"
                strokeWidth="1.5"
                stroke="currentColor"
                className="size-6"
              >
                <path
                  strokeLinecap="round"
                  strokeLinejoin="round"
                  d="M3.75 6.75h16.5M3.75 12h16.5m-16.5 5.25h16.5"
                />
              </svg>
            </button>
          </div>
          <div
            className={`w-full lg:inline-flex lg:w-auto mt-2 lg:mt-0 ${
              navbarOpen ? "" : "hidden"
            }`}
          >
            <ul className="nav6 md:p-4 flex flex-col justify-between space-x-4 items-center">
              {["Product", "Our Why", "About Us", "Contact"].map((item) => (
                <li key={item}>
                  <a
                    href="#"
                    className="flex px-4 py-2 rounded-md font-medium text-black hover:bg-black hover:text-white"
                  >
                    {item}
                  </a>
                </li>
              ))}
            </ul>
          </div>
        </nav>
      </div>
    </header>
  );
};

export default Header;
